        <Router>
            <div className="App">
                <Header/>
                <Sidebar/>
                <div className={App.appWrapper}>
                    <Switch>
                        <Route path="/home" element={<Home/>}/>
                        <Route path="/products" element={<Products/>}/>
                        {/*<Route path={"/home"} elements={<Home/>}/>*/}
                        {/*<Main/>*/}
                        {/*<Products/>*/}
                        {/*<Chats/>*/}
                    </Switch>
                </div>
                <Footer/>
            </div>
        </Router>
    );
}

export default App;
